Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(List(
      ("query1", 1614345600),
      ("query2", 1614345601),
      ("query1", 1614345602),
      ("query3", 1614345603),
      ("query1", 1614345604),
      ("query2", 1614345605),
      ("query4", 1614345606),
      ("query1", 1614345607),
      ("query2", 1614345608),
      ("query3", 1614345609)
    )).map(x => (x._1, x._2)).toJavaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.sparkContext.parallelize(List(
      "query1",
      "query2",
      "query3"
    )).toJavaRDD()

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Int)]()

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val currentTime = System.currentTimeMillis() / 1000
      val hitRateList = new ListBuffer[(String, Int)]()

      iter.foreach { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          if (cache.contains(query)) {
            val (lastAccessTime, hitCount) = cache(query)
            if (currentTime - lastAccessTime <= 12 * 60 * 60) {
              // Cache hit
              cache.update(query, (currentTime, hitCount + 1))
              hitRateList.append((query, 1))
            } else {
              // Cache miss
              cache.update(query, (currentTime, 1))
              hitRateList.append((query, 0))
            }
          } else {
            // Cache miss
            cache.put(query, (currentTime, 1))
            hitRateList.append((query, 0))
          }
        }
      }

      hitRateList.toIterator
    }).reduceByKey(_ + _).map { case (query, hitCount) =>
      (query, hitCount.toDouble / (onsiteData.filter(x => x._1 == query).count()))
    }.collect()

    // Print hit rate
    hitRate.foreach(x => println(s"${x._1}: ${x._2}"))

    spark.stop()
  }
}
```
